import React, { Component } from 'react'

export default class MobileOprating extends Component {
    render() {
        return (
            <div>
                <ol>
                    <li>Android</li>
                    <li>BlackBerry</li>
                    <li>iphone</li>
                    <li>WindowPhone</li>
                </ol>
            </div>
        )
    }
}
